import img1 from './sharva1.png';
import img2 from './sharva2.png';
import img3 from './sharva3.png';
import img4 from './sharva1.png';

export const Gal=[
  {
    image:img1,
    height:'450px',
    width:'450px',
    dataaos:'fade-right',
    dataaosduration:'2000'
  },
  {
    image:img2,
    height:'450px',
    width:'550px',
    dataaos:'fade-left',
    dataaosduration:'2000'
  },
  {
    image:img3,
    height:'650px',
    width:'350px',
    dataaos:'fade-up',
    dataaosduration:'2000'
  }
]
